English recording artist Ellie Goulding covered &quot;Your Song&quot; for inclusion on the re-release of her debut album, entitled Bright Lights. It was released digitally as the re-release's lead single in the United Kingdom on 12 November 2010.[13] It debuted on the UK Singles Chart at number thirty-nine on the issue dated 20 November 2010, and rose to number three the following week, earning Goulding her highest-peaking single to date. The song is featured in the Christmas 2010 TV advert for the department store chain John Lewis.[
